import { Bar , Wrapper, Content } from './Loader.styles'

export default function Loader() {

return (
<Wrapper>
    <Content>
        <Bar wait="250ms"/>
        <Bar wait="750ms"/>
        <Bar wait="550ms"/>
        <Bar wait="25ms"/>
        <Bar wait="150ms"/>
    </Content>
</Wrapper>


    )
}
